import React, { Component } from "react";
import Radar from "react-d3-radar";

class DOA extends Component {
  render() {
    return (
      <Radar
        width={500}
        height={500}
        padding={10}
        domainMax={10}
        highlighted={null}
        onHover={point => {
          if (point) {
            console.log("hovered over a data point");
          } else {
            console.log("not over anything");
          }
        }}
        data={{
          variables: [
            { key: "0", label: "0" },
            { key: "45", label: "45" },
            { key: "90", label: "90" },
            { key: "135", label: "135" },
            { key: "180", label: "180" },
            { key: "225", label: "225" },
            { key: "270", label: "270" },
            { key: "315", label: "315" }
          ],
          sets: [
            {
              key: "me",
              label: "My Scores",
              values: {
                resilience: 4,
                strength: 6,
                adaptability: 7,
                creativity: 2,
                openness: 8,
                confidence: 1
              }
            },
            {
              key: "everyone",
              label: "Everyone",
              values: {
                resilience: 10,
                strength: 8,
                adaptability: 6,
                creativity: 4,
                openness: 2,
                confidence: 0
              }
            }
          ]
        }}
      />
    );
  }
}

export default DOA;
